import React from "react";
import TextField from "@material-ui/core/TextField";
import Button from "@material-ui/core/Button";
const Search = () => {
  return (
    <div>
      <form noValidate autoComplete='off' className="searchForm">
        <TextField variant="outlined" label="City" className="formItem" required />
        <TextField
          variant="outlined"
          label="Country Code"
          className="formItem"
        />
        <Button type='submit' variant="contained" color="primary" className="formItem">
          Search
        </Button>
      </form>
    </div>
  );
};

export default Search;
